import { Button } from 'react-bootstrap'
import "bootstrap/dist/css/bootstrap.min.css"

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <Button>Hello World</Button>
      </header>
    </div>
  );
}

export default App;
